import React from "react";

const Turnover = () => {
  return (
    <div className="bg-informationBackground min-h-screen">
      <div className="mx-auto bg-white max-w-5xl min-h-screen">
        <div className="flex flex-row p-5 gap-5 items-center justify-end">
          <button className="bg-common-blue rounded-sm text-white text-sm px-6 py-1">চলমান</button>

          <button className="bg-gray-200 rounded-sm hover:bg-gray-400 px-6 text-sm py-1">সম্পন্ন</button>
        </div>
      </div>
    </div>
  );
};

export default Turnover;
